// src/pages/RealEstatePage.js
import React from 'react';
import './RealEstatePage.css';
import '../styles/global.css';
import luxuryApartmentsImage from './images/luxury-apartments.jpg';
import businessPropertiesImage from './images/business-properties.jpg';
import virtualToursImage from './images/virtual-tours.jpg';

const RealEstatePage = () => {
  return (
    <div className="real-estate">
      <h1>Real Estate</h1>
      <div className="property">
        <img src={luxuryApartmentsImage} alt="Luxury Apartments" />
        <h2>Luxury Apartments</h2>
        <p>High-end residential properties for discerning clients.</p>
      </div>
      <div className="property">
        <img src={businessPropertiesImage} alt="Business Properties" />
        <h2>Business Properties</h2>
        <p>Commercial properties suited for business operations.</p>
      </div>
      <div className="property">
        <img src={virtualToursImage} alt="Virtual Tours" />
        <h2>Virtual Tours</h2>
        <p>Experience our properties virtually from anywhere in the world.</p>
      </div>
    </div>
  );
};

export default RealEstatePage;
